css:
atom-text-editor,
:host {
  background: #202022;
  color: #d5d5d1;
  line-height: 1.5em;
}
atom-text-editor .selection .region,
:host .selection .region {
  background: rgba(255, 255, 255, 0.1);
}
atom-text-editor .underlayer,
:host .underlayer {
  background: url(data:image/png;base64,);
}
atom-text-editor .wrap-guide,
:host .wrap-guide {
  background: #2f2f2f;
}
atom-text-editor .vertical-scrollbar,
:host .vertical-scrollbar {
  top: 5px;
  right: 5px;
  bottom: 5px;
}
atom-text-editor .gutter,
:host .gutter {
  background: #141417;
  margin-right: 3px;
  overflow: visible;
  box-shadow: inset -1px 0 #2f2f2f;
}
atom-text-editor .line-number,
:host .line-number {
  color: #5f5f5f;
}
atom-text-editor .line-number.cursor-line,
:host .line-number.cursor-line {
  background: rgba(255, 255, 255, 0.04);
  position: relative;
}
atom-text-editor .line-number.cursor-line:after,
:host .line-number.cursor-line:after {
  content: '';
  background: rgba(255, 255, 255, 0.1);
  width: 4px;
  height: 100%;
  position: absolute;
  top: 0;
  right: -3px;
  bottom: 0;
}
atom-text-editor .line-number.cursor-line-no-selection,
:host .line-number.cursor-line-no-selection {
  background: rgba(0, 0, 0, 0.4);
}
atom-text-editor .line-number.cursor-line-no-selection:after,
:host .line-number.cursor-line-no-selection:after {
  background: rgba(0, 0, 0, 0.3);
  width: 3px;
}
atom-text-editor .lines,
:host .lines {
  box-shadow: none;
}
atom-text-editor .indent-guide,
:host .indent-guide {
  box-shadow: none;
}
atom-text-editor .indent-guide:not(:first-child),
:host .indent-guide:not(:first-child) {
  box-shadow: inset 1px 0 #2f2f2f;
}
atom-text-editor .line.cursor-line,
:host .line.cursor-line {
  background: rgba(0, 0, 0, 0.3);
}
atom-text-editor .invisible-character,
:host .invisible-character {
  color: #5a5958;
}
atom-text-editor .text .comment,
:host .text .comment,
atom-text-editor .source .comment,
:host .source .comment {
  font-style: italic;
  color: #5a5958;
}
atom-text-editor .text .meta.function .name,
:host .text .meta.function .name,
atom-text-editor .source .meta.function .name,
:host .source .meta.function .name {
  color: #7abcd1;
}
atom-text-editor .text .meta.brace,
:host .text .meta.brace,
atom-text-editor .source .meta.brace,
:host .source .meta.brace {
  color: #918970;
}
atom-text-editor .text .keyword.operator,
:host .text .keyword.operator,
atom-text-editor .source .keyword.operator,
:host .source .keyword.operator {
  color: #a38259;
}
atom-text-editor .text .keyword.control,
:host .text .keyword.control,
atom-text-editor .source .keyword.control,
:host .source .keyword.control {
  color: #cf8554;
}
atom-text-editor .text .variable.assignment,
:host .text .variable.assignment,
atom-text-editor .source .variable.assignment,
:host .source .variable.assignment {
  color: #b8b394;
}
atom-text-editor .text .variable.parameter,
:host .text .variable.parameter,
atom-text-editor .source .variable.parameter,
:host .source .variable.parameter {
  color: #dad672;
}
atom-text-editor .text .variable.instance,
:host .text .variable.instance,
atom-text-editor .source .variable.instance,
:host .source .variable.instance {
  color: #7ac096;
}
atom-text-editor .text .string,
:host .text .string,
atom-text-editor .source .string,
:host .source .string {
  color: #98c06c;
}
atom-text-editor .text .string.regexp,
:host .text .string.regexp,
atom-text-editor .source .string.regexp,
:host .source .string.regexp {
  color: #eebc71;
}
atom-text-editor .text .string .embedded.source,
:host .text .string .embedded.source,
atom-text-editor .source .string .embedded.source,
:host .source .string .embedded.source {
  color: #6abe9d;
}
atom-text-editor .text .storage.type.function,
:host .text .storage.type.function,
atom-text-editor .source .storage.type.function,
:host .source .storage.type.function {
  color: #a38259;
}
atom-text-editor .text .storage.modifier,
:host .text .storage.modifier,
atom-text-editor .source .storage.modifier,
:host .source .storage.modifier {
  color: #a38259;
}
atom-text-editor .text .storage.class,
:host .text .storage.class,
atom-text-editor .source .storage.class,
:host .source .storage.class {
  color: #db8286;
}
atom-text-editor .text .entity.instance,
:host .text .entity.instance,
atom-text-editor .source .entity.instance,
:host .source .entity.instance {
  color: #74afb4;
}
atom-text-editor .text .entity.type.object,
:host .text .entity.type.object,
atom-text-editor .source .entity.type.object,
:host .source .entity.type.object {
  color: #db8286;
}
atom-text-editor .text .support.class,
:host .text .support.class,
atom-text-editor .source .support.class,
:host .source .support.class {
  color: #74afb4;
}
atom-text-editor .text .support.function,
:host .text .support.function,
atom-text-editor .source .support.function,
:host .source .support.function {
  color: #eebc71;
}
atom-text-editor .text .constant,
:host .text .constant,
atom-text-editor .source .constant,
:host .source .constant {
  color: #f1ee91;
}
atom-text-editor .text .language.variable,
:host .text .language.variable,
atom-text-editor .source .language.variable,
:host .source .language.variable {
  color: #f1ee91;
}
